import cx from "clsx";
import styles from "./Button.module.css";

const Button = (props) => {
  return (
    <button
      className={cx(styles.button,props.className)}
      type={props.type || "button"}
      onClick={props.onClick}
    >
      {props.children}
    </button>
  );
};

export default Button;
